import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Card";
import Sdata from "./Sdata";
import ('./index.css');


const favSeries = "amazon";
const Favs = ()=> {
if (favSeries === "netflix") {
      return (
        <Card
          key={Sdata[1].id}
          imgsrc={Sdata[1].imgscr}
          title={Sdata[1].title}
          sname={Sdata[1].sname}
          link={Sdata[1].link}
        />
      );
  }else{
      return (
        <Card
          key={Sdata[2].id}
          imgsrc={Sdata[2].imgscr}
          title={Sdata[2].title}
          sname={Sdata[2].sname}
          link={Sdata[2].link}
        />
      );
  }
}
ReactDOM.render( 
    <>

    <h1 className="heading_style">List of top Netflix series in 2020</h1>
    
    <Favs />
    
    {/* {Sdata.map(ncard)}; */}
    </>,
    document.getElementById('root')
    );
